/**
 * 基础函数，对array进行切片，从rawStart索引开始，到rawEnd结束（左闭右开）
 * 注意该函数和wdk.slice略有不同，其为提升性能做了简化，未考虑非法类型的输入也没有默认值
 * @param array，要切片的数组
 * @param rawStart，切片起始索引
 * @param rawEnd，切片终止索引
 * @return 返回切片后的数组
 */
declare function baseSlice(array: any[], rawStart: number, rawEnd: number): any[];
export default baseSlice;
